import m from 'mithril'
import {
  Button,
  ControlGroup,
  Icon,
  Input,
  Dialog,
  Icons,
  PopoverMenu,
  Card
} from 'construct-ui'
import {showToast} from './Nav'

let content = m(ControlGroup, {
  class: 'new-client-inputs'
}, [
  m(Input, {
    contentLeft: m(Icon, {name: Icons.USER}),
    type: 'text',
    name: 'client-name',
    placeholder: 'Name'
  }),
  m(Input, {
    contentLeft: m(Icon, {name: Icons.USER}),
    type: 'text',
    name: 'client-surname',
    placeholder: 'Surname'
  }),
  m(Input, {
    contentLeft: m(Icon, {name: Icons.MAIL}),
    type: 'text',
    name: 'client-mail',
    placeholder: 'email'
  }),
  m(Input, {
    contentLeft: m(Icon, {name: Icons.PHONE}),
    type: 'text',
    name: 'client-phone',
    placeholder: 'Telephone'
  }),
  m(Button, {
    type: 'submit',
    label: "Add Client",
    // UPDATE CLIENT
    onclick: async () => {}
  })
])

let Clients = {
  clientsList: [],
  dialogOpen: false,
  loadClients: () => {
    m.request({method: "GET", url: `/api/listClients`}).then(res => Clients.clientsList = res)
  },
  close(vnode) {
    vnode.state.dialogOpen = false
  },
  oninit: () => {
    if (Clients.clientsList.length === 0) {
      Clients.loadClients()
    }
    console.log(content);
  },
  view: (vnode) => {
    return Clients.clientsList.map((client, i) => {
      return [m(Card, {
          class: 'client-card',
          url: client._id,
          elevated: 2,
          interactive: true,
          fluid: true
        }, m(PopoverMenu, {
          closeOnContentClick: true,
          content: [
            m(Button, {
              iconLeft: Icons.EDIT,
              label: 'Edit',
              basic: true,
              align: 'center',
              onclick: (e) => {
                e.preventDefault();
                e.stopPropagation();
                vnode.state.dialogOpen = true
              }
            }),
            m(Button, {
              iconLeft: Icons.TRASH,
              intent: 'negative',
              label: 'Delete',
              basic: true,
              align: 'center',
              onclick: (e) => {
                e.preventDefault();
                e.stopPropagation();
                m.request({method: 'DELETE', url: `/api/delete/${client._id}`}).then(client => {
                  showToast('Deleted client', 'negative')
                  console.log(client);
                  let removedClient = Clients.clientsList.splice(i, 1)[0]
                  console.log(Clients.clientsList, removedClient);
                  m.redraw()
                })
              }
            })
          ],
          trigger: m(Button, {
            iconLeft: Icons.SETTINGS,
            style: 'float:right;'
          })
        }), m("h1#client-name", client.name + ' ' + client.surname), m(Button, {
          class: 'mail-copy-button',
          label: `mail: ${client.mail}`,
          iconLeft: Icons.COPY,
          basic: true,
          onclick: (e) => {
            e.preventDefault()
            navigator.clipboard.writeText(client.mail)
          }
        }), m(Button, {
          class: 'phone-copy-button',
          label: `phone: ${client.phone
            ? client.phone
            : ''} `,
          iconLeft: Icons.COPY,
          basic: true,
          onclick: (e) => {
            e.preventDefault()
            navigator.clipboard.writeText(client.phone)
          }
        }), m(Dialog, {
          autofocus: true,
          basic: true,
          closeOnEscapeKey: true,
          closeOnContentClick: true,
          hasBackdrop: false,
          isOpen: vnode.state.dialogOpen,
          title: `Edit Customer ${client.fullname}`,
          // content: content,
          footer: m('div', m(Button, {label: 'Close'}), m(Button, {
            label: 'Save',
            intent: 'positive'
          })),
          content: m(ControlGroup, {
            style: 'flex-wrap: wrap;'
          }, m(Input, {
            contentLeft: m(Icon, {name: Icons.USER}),
            type: 'text',
            name: 'client-name',
            placeholder: 'Name'
          }), m(Input, {
            contentLeft: m(Icon, {name: Icons.USER}),
            type: 'text',
            name: 'client-surname',
            placeholder: 'Surname'
          }), m(Input, {
            contentLeft: m(Icon, {name: Icons.MAIL}),
            type: 'text',
            name: 'client-mail',
            placeholder: 'email'
          }), m(Input, {
            contentLeft: m(Icon, {name: Icons.PHONE}),
            type: 'text',
            name: 'client-phone',
            placeholder: 'Telephone'
          }))
        }))]
    })
  }
}

exports.Clients = Clients
